import { CommonModule } from '@angular/common';
import { Component, Inject } from '@angular/core';
import { ReactiveFormsModule, FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MatCheckboxModule } from '@angular/material/checkbox';
import { MatIconModule } from '@angular/material/icon';
import { MatInputModule } from '@angular/material/input';
import { MatSelectModule } from '@angular/material/select';
import { MatSlideToggleModule } from '@angular/material/slide-toggle';
import { AdminCenterService } from '../admin-center-service';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import { CommonToaster } from '../../../shared/services/common-toaster';


@Component({
  selector: 'app-admin-center-add-branch',
  imports: [
    CommonModule,
    MatSelectModule,
    MatInputModule,
    MatIconModule,
    ReactiveFormsModule,
    MatSlideToggleModule,
    MatCheckboxModule
  ],
  templateUrl: './admin-center-add-branch.html',
  styleUrl: './admin-center-add-branch.scss',
})
export class AdminCenterAddBranch {
  productForm!: FormGroup;
  isEditMode = false;

  // Dropdown Options
  channels = ["SMS", "Email", "App", "Web"];
  categories = ["Login", "Transaction", "Reset", "Verification"];
  domains = ["Banking", "Insurance", "Fintech", "Wallet"];
  blockDurations = ["30 Sec", "1 Min", "2 Min", "5 Min"];
  types = ["Primary", "Secondary", "Backup"];
  deliveryModesOptions = ["SMS", "Email", "WhatsApp", "IVR"];
  countries = ['India', 'UAE', 'Qatar'];
  cities = ['Delhi', 'Mumbai', 'Dubai', 'Doha'];
  branchId: any;



  constructor(private fb: FormBuilder, private adminCenterService: AdminCenterService, @Inject(MAT_DIALOG_DATA) public data: any,
    private commonToaster: CommonToaster, private dialogRef: MatDialogRef<AdminCenterAddBranch>) {
    this.productForm = this.fb.group({
      branchCode: [''],
      branchNameEn: [''],
      fullAddressEn: [''],
      shortAddress: [''],

      country: [''],
      cityEn: [''],
      latitude: [''],
      longitude: [''],
      timing: [''],
      workingHours: [''],

      // checkboxes
      cashDispenser: [false],
      recycler: [false],
      cdm: [false],
      chequeDM: [false],

      ramp: [false],
      wheelchair: [false],

      inr: [false],
      qar: [false],
      aed: [false],
      usd: [false],

      feature1: [false],
      feature2: [false],
      feature3: [false],
      feature4: [false],

      status: [true]
    });

  }

   ngOnInit(): void {
    this.buildForm();

    if (this.data?.editData) {
      this.isEditMode = true;
      this.patchForm(this.data.editData);
    }
  }

   buildForm() {
    this.productForm = this.fb.group({
      branchCode: ['', Validators.required],
      branchNameEn: ['', Validators.required],
      fullAddressEn: ['', Validators.required],
      shortAddress: ['', Validators.required],
      country: ['', Validators.required],
      cityEn: ['', Validators.required],
      latitude: ['', Validators.required],
      longitude: ['', Validators.required],
      timing: ['', Validators.required],
      workingHours: ['', Validators.required],
      cashDispenser: ['', Validators.required],
      recycler: [true],
      chequeDM: [''],
      ramp: [''],
      wheelchair: [''],
      feature1: [''],
      feature2: [''],
      feature3: [''],
      feature4: [''],
      status: [''],
      cdm: ['']
    });
  }

  patchForm(p: any) {
    this.branchId = p.branchId;
    console.log('edit-p', p)
    this.productForm.patchValue({
        branchCode: p.branchCode,
      branchHolidayList: [],
      branchId: p.branchId,
      branchImageBase64: '',
      branchImageName: "image.png",
      branchNameAr: '',
      branchNameEn: p.branchNameEn,
      cityAr: '',
      cityEn: p.cityEn,
      fullAddressAr: '',
      fullAddressEn: p.fullAddressEn,
      isActive: p.isActive,
      isCashDepositAvailable: 'N',
      isCashWithdrawalAvailable: 'N',
      isCcAvailable: 'N',
      isChequeBookAvailable: 'N',
      isChequeDepositAvailable: 'N',
      isDdAvailable: 'N',
      isPpAvailable: 'N',
      latitude: p.latitude,
      longitude: p.longitude,
      timings: '',
      workingHoursAr: '',
      workingHoursEn: p.workingHours,
      dayTime: [
        {
          "day": "Sunday",
          "fromTime": "09:00",
          "toTime": "17:00"
        }
      ]
    });
  }

  submitForm() {
    // if (this.productForm.invalid) return;
    const productForm = this.productForm.value;
    console.log('data', productForm)

    const payload = {
      branchCode: productForm.branchCode,
      branchHolidayList: [],
      branchId: this.branchId,
      branchImageBase64: '',
      branchImageName: "image.png",
      branchNameAr: '',
      branchNameEn: productForm.branchNameEn,
      cityAr: '',
      cityEn: productForm.cityEn,
      fullAddressAr: '',
      fullAddressEn: productForm.fullAddressEn,
      isActive: productForm.isActive,
      isCashDepositAvailable: 'N',
      isCashWithdrawalAvailable: 'N',
      isCcAvailable: 'N',
      isChequeBookAvailable: 'N',
      isChequeDepositAvailable: 'N',
      isDdAvailable: 'N',
      isPpAvailable: 'N',
      latitude: productForm.latitude,
      longitude: productForm.longitude,
      timings: '',
      workingHoursAr: '',
      workingHoursEn: productForm.workingHours,
      dayTime: [
        {
          "day": "Sunday",
          "fromTime": "09:00",
          "toTime": "17:00"
        }
      ]
    };

    if (this.isEditMode) {
      this.adminCenterService.updateBranchLocator(payload).subscribe((res: any) => {
        console.log('ressss', res);

        if (res?.status.code == "000000") {
          this.commonToaster.showSuccess('Product created successfully');
          this.dialogRef.close('retaiClose');
        } else {

        }
      })
    } else {
      this.adminCenterService.createBranchLocator(payload).subscribe((res: any) => {
        console.log('create', res);
        if (res?.status.code == "000000") {
          this.commonToaster.showSuccess('Branch created successfully');
          this.dialogRef.close('retaiClose');
          this.adminCenterService.trigger();
        }

      })
    }
  }

  closeForm() { }
}
